	function testfx(msg,payloads)
	{
		if(msg)

			target = document.getElementById("target")
			for(var i = 0; i < msg.length; i++)

				var x = document.createElement("IMG");
				x.alt = img.name
				x.src = img.url
				target.appendChild(x)
			}
		}
	}

}
